import React from 'react';
import "../../styles/LoginNav.css";
import { Link } from "react-router-dom";

const Dashboard = () => (

    <div className="dashboard-main">
      <ul className="sidenav">
        <img className="dashboard-logo" src={require('../../assets/logo1.png')}></img>
        <h3 className="hi">Hi Name!</h3>
        <Link
          to="/search-jobs"
          className={
            window.location.pathname === "/search-jobs" ? "nav-link active" : "nav-link"
          }
        >
          Search Jobs
        </Link>
        <Link
          to="/learn"
          className={
            window.location.pathname === "/learn" ? "nav-link active" : "nav-link"
          }
        >
          Dashboard
        </Link>
        <Link
          to="/login"
          className={
            window.location.pathname === "/login" ? "nav-link active" : "nav-link"
          }
        >
          Messages
        </Link>
        <Link
          to="/post"
          className={
            window.location.pathname === "/post-a-job" ? "nav-link active" : "nav-link"
          }
        >
          Saved Posts
        </Link>
        <Link
          to="/post"
          className={
            window.location.pathname === "/post-a-job" ? "nav-link active" : "nav-link"
          }
        >
          Logout
        </Link>
      </ul>
      </div>
      );

export default Dashboard
